import styled from "styled-components";

export const StNews = styled.div`
  display: flex;
  flex-direction: row;
  justify-content: space-around;
  flex-wrap: wrap;
  align-items: center;
  border: 2px solid rgb(105, 105, 105);
  border-radius: 8px;
  background-color: rgba(255, 255, 255, 0.787);
`
